import React from 'react';
import { Link } from 'react-router-dom';
import './header.css';
import barritaImage from '../Imagenes/barritaImage.png';  
import 'bootstrap/dist/css/bootstrap.min.css';  

const Header = () => {
  return (
    <header className="header">
      <div className="container1">
        <div className="row align-items-center">
          <div className="col-6 col-md-3">
            <img src={barritaImage} alt="Barrita Romulo" className="img-fluid barrita-image" />
          </div>
          <div className="col-6 col-md-9">
            <nav className="navbar navbar-expand-md">
              <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
              </button>
              <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav ms-auto">
                  <li className="nav-item"><Link className="nav-link" to="/">Home</Link></li>
                  <li className="nav-item"><Link className="nav-link" to="/catalogo">Catalogo</Link></li>
                  <li className="nav-item"><Link className="nav-link" to="/promocion">Promociones</Link></li>
                  <li className="nav-item"><Link className="nav-link" to="/favoritos">Favoritos</Link></li>
                  <li className="nav-item"><Link className="nav-link" to="/carrito">Carrito</Link></li>
                  <li className="nav-item"><Link className="nav-link" to="/login">Login/Registro</Link></li>
                </ul>
              </div>
            </nav>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
